import React, { useState } from "react";
import universityData from "./UniversityData";
import {
  LineChart,
  Line,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
} from "recharts";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(null);
  const [selectedSubject, setSelectedSubject] = useState(null);
  const [selectedStudentType, setSelectedStudentType] = useState("International");
  const [cgpa, setCgpa] = useState("");
  const [sat, setSat] = useState("");

  const handleUniversityChange = (e) => {
    const uni = universityData.find((u) => u.name === e.target.value);
    setSelectedUniversity(uni);
    setSelectedSubject(null);
  };

  const handleSubjectChange = (e) => {
    const subj = selectedUniversity.subjects.find((s) => s.name === e.target.value);
    setSelectedSubject(subj);
  };

  const calculateGPA = (cgpa) => {
    if (!cgpa || isNaN(cgpa)) return 0;
    return (cgpa / 10 * 4).toFixed(2);
  };

  const estimateAdmission = () => {
    if (!selectedSubject || !cgpa || !sat) return "";

    const gpa = parseFloat(calculateGPA(cgpa));
    const gpaCutoff = parseFloat(selectedSubject.gpaCutoff);
    const satCutoff = parseInt(selectedSubject.satCutoff);

    if (gpa >= gpaCutoff && sat >= satCutoff) return "Likely";
    if (gpa + 0.2 >= gpaCutoff && sat + 50 >= satCutoff) return "Doubtful";
    return "Highly Unlikely";
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>QS World University Rankings Explorer</h1>

      <label>Select University:</label>
      <select onChange={handleUniversityChange} value={selectedUniversity?.name || ""}>
        <option value="">-- Select --</option>
        {universityData.map((uni) => (
          <option key={uni.name} value={uni.name}>
            {uni.name}
          </option>
        ))}
      </select>

      <br /><br />

      <label>Student Type:</label>
      <select
        onChange={(e) => setSelectedStudentType(e.target.value)}
        value={selectedStudentType}
      >
        <option value="International">International</option>
        <option value="Domestic">Domestic</option>
      </select>

      {selectedUniversity && (
        <>
          <h2>{selectedUniversity.name}</h2>
          <p><strong>General QS Rank:</strong> {selectedUniversity.qsRank}</p>

          <label>Select Subject:</label>
          <select onChange={handleSubjectChange} value={selectedSubject?.name || ""}>
            <option value="">-- Select --</option>
            {selectedUniversity.subjects.map((subject) => (
              <option key={subject.name} value={subject.name}>
                {subject.name}
              </option>
            ))}
          </select>
        </>
      )}

      {selectedSubject && (
        <>
          <h3>{selectedSubject.name}</h3>
          <p><strong>QS Subject Rank:</strong> {selectedSubject.qsRank}</p>
          <p><strong>Start Date:</strong> {selectedSubject.startDate}</p>
          <p>
            <strong>Fees:</strong>{" "}
            {selectedSubject.fees?.[selectedStudentType] || "Not Available"}
          </p>
          <p>
            <strong>Eligibility:</strong>{" "}
            {selectedSubject.eligibility?.[selectedStudentType] || "Not Available"}
          </p>
          <p>
            <strong>Intakes per Year:</strong>{" "}
            {selectedSubject.intakes?.[selectedStudentType] || "Not Available"}
          </p>
          <p>
            <strong>Application Deadlines:</strong>{" "}
            {selectedSubject.deadlines?.[selectedStudentType] || "Not Available"}
          </p>
          <p>
            <strong>Scholarship Info:</strong> {selectedSubject.scholarship || "Not Available"}
          </p>

          <h4>Student Inputs</h4>
          <label>Enter CGPA (out of 10): </label>
          <input type="number" value={cgpa} onChange={(e) => setCgpa(e.target.value)} />
          <br />
          <label>Enter SAT Score: </label>
          <input type="number" value={sat} onChange={(e) => setSat(e.target.value)} />
          <p><strong>Estimated GPA (out of 4):</strong> {calculateGPA(cgpa)}</p>
          <p><strong>Estimated Admission Probability:</strong> {estimateAdmission()}</p>

          <p>
            <strong>Course Link:</strong>{" "}
            <a href={selectedSubject.courseLink} target="_blank" rel="noopener noreferrer">
              {selectedSubject.courseLink}
            </a>
          </p>

          <h4>QS Rankings (Last 5 Years)</h4>
          <table border="1" cellPadding="5">
            <thead>
              <tr>
                <th>Year</th>
                <th>QS Rank</th>
                <th>GPA Cutoff</th>
                <th>SAT Cutoff</th>
              </tr>
            </thead>
            <tbody>
              {selectedSubject.rankOverYears.map((yearData, index) => (
                <tr key={index}>
                  <td>{yearData.year}</td>
                  <td>{yearData.qsRank}</td>
                  <td>{selectedSubject.gpaCutoff}</td>
                  <td>{selectedSubject.satCutoff}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <br />
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={selectedSubject.rankOverYears}>
              <CartesianGrid stroke="#ccc" />
              <XAxis dataKey="year" />
              <YAxis domain={['dataMin - 1', 'dataMax + 1']} allowDecimals={false} />
              <Tooltip />
              <Line type="monotone" dataKey="qsRank" stroke="#8884d8" strokeWidth={3} />
            </LineChart>
          </ResponsiveContainer>
        </>
      )}
    </div>
  );
}

export default App;
